import React from "react";

class Patient extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: props.name,
      userId: props.userId,
      checkList: props.checkList,
      province: props.province,
    };
  }

  render() {
    return (
      <div className="Patient">
        <h2>
          Name:
          {this.state.name}
        </h2>
        <p>
          user id:
          {this.state.userId}
        </p>
        <p>action:</p>
        <button className="actionButton">kick</button>
      </div>
    );
  }
}

export default Patient;
